INSERT INTO `kelas` VALUES (14563,'Voluptatem rerum ducimus omnis autem earum.','voluptatem-rerum-ducimus-omnis-autem-earum','Pemula','Possimus sit inventore consectetur vitae doloribus libero incidunt nobis et quis sapiente aliquam non quas deserunt facere debitis veniam quasi incidunt sit consequatur libero nihil magni ea culpa ipsum.','620269','1','kelas.jpg','2021-05-26 00:00:00','2021-05-26 00:00:00'),(50716,'Nam voluptatum et rerum nemo at consectetur.','nam-voluptatum-et-rerum-nemo-at-consectetur','Pemula','Esse veritatis dolores ipsam ex veritatis sed praesentium neque dolores est aspernatur impedit repellendus consequatur deleniti odio ad temporibus aspernatur quisquam.','544384','1','kelas.jpg','2021-05-26 00:00:00','2021-05-26 00:00:00'),(61530,'Enim provident unde quas voluptatem enim.','enim-provident-unde-quas-voluptatem-enim','Pemula','Eos optio eaque aut officia qui accusamus veniam nesciunt placeat voluptates unde corrupti expedita sequi qui quae molestias sit mollitia quis sunt voluptatibus odit vel voluptas.','241060','1','kelas.jpg','2021-05-26 00:00:00','2021-05-26 00:00:00'),(69109,'Sed est aliquid sunt sapiente commodi.','sed-est-aliquid-sunt-sapiente-commodi','Pemula','Quam illo voluptatem in vel molestias non perspiciatis deleniti fugit hic illum sed quam eum adipisci eius non occaecati corrupti placeat ea sed.','814638','1','kelas.jpg','2021-05-26 00:00:00','2021-05-26 00:00:00'),(71788,'A ipsum voluptatem debitis quasi rerum est.','a-ipsum-voluptatem-debitis-quasi-rerum-est','Pemula','Ullam et et aut ut in et laudantium ut labore voluptas occaecati vitae omnis molestias aut distinctio vero maiores voluptate quidem est rerum minus esse dolores itaque quisquam nihil ut in ab quo nobis.','611070','1','kelas.jpg','2021-05-26 00:00:00','2021-05-26 00:00:00'),(76769,'Molestiae est quidem dolores sapiente ad sapiente.','molestiae-est-quidem-dolores-sapiente-ad-sapiente','Pemula','Ut assumenda delectus sequi eligendi ex animi ducimus corrupti deserunt rerum qui hic beatae tenetur vero facere iste atque non quo illum sit et repellat neque est delectus voluptatem.','319987','1','kelas.jpg','2021-05-26 00:00:00','2021-05-26 00:00:00'),(81338,'Sint porro qui provident excepturi autem in sequi provident.','sint-porro-qui-provident-excepturi-autem-in-sequi-provident','Pemula','Tempore est molestias id ut sint velit nemo nobis tempore sed nesciunt earum non aut aut quisquam placeat aperiam ea sint aspernatur mollitia velit fuga rerum labore et odio quod.','240287','1','kelas.jpg','2021-05-26 00:00:00','2021-05-26 00:00:00'),(84667,'Nulla omnis natus eaque natus atque.','nulla-omnis-natus-eaque-natus-atque','Pemula','Odio omnis et vitae et aut eveniet aut hic et ut praesentium magni sint molestias nostrum facilis veritatis placeat id delectus et autem sapiente enim reiciendis quod quod quae.','906489','1','kelas.jpg','2021-05-26 00:00:00','2021-05-26 00:00:00'),(97236,'Laboriosam corporis sit qui nihil corporis.','laboriosam-corporis-sit-qui-nihil-corporis','Pemula','Excepturi explicabo esse temporibus nihil accusamus praesentium velit modi quasi occaecati libero culpa perferendis quo dolorum nulla nostrum voluptatem ut dolor nisi quos molestias non et quae incidunt ut et.','525447','1','kelas.jpg','2021-05-26 00:00:00','2021-05-26 00:00:00'),(97241,'Membuat Portfolio Dengan Bootstrap5','membuat-portfolio-dengan-bootstrap5','beginer','Di kelas ini kita akan belajar membuat porfolio dengan menggunakan bootstrap 5 framework,','0','3','kelas.jpg','2021-06-03 18:41:33','2021-06-03 18:41:33');
